import React from 'react';
import './App.css';
import PrintPdf from './components/pdf/pdfFile';

function App() {
  const generatePdfFile = () => {
    const sections = [{
      heading: 'Section 1',
      images: [
        'data:image/jpeg;base64,',
        'data:image/jpeg;base64,'
      ]
    }]
    PrintPdf(sections, 5, 8);
  }
  return (
    <div><h1>Hello, Welcome to pdfMake App</h1>
    <button onClick={generatePdfFile}>Generate Pdf</button>
    </div>
  );
}

export default App;
 